INSERT INTO `youtube_channels` (`id`, `channel_id`, `name`, `description`, `thumbnail`) VALUES
(1, 'UCAuUUnT6oDeKwE6v1NGQxug', 'TED', 'The TED Talks channel features the best talks and performances from the TED Conference, where the world\'s leading thinkers and doers give the talk of their lives in 18 minutes (or less). Look for talks on Technology, Entertainment and Design -- plus science, business, global issues, the arts and more. You\'re welcome to link to or embed these videos, forward them to others and share these ideas with people you know.\n\nTED\'s videos may be used for non-commercial purposes under a Creative Commons License, Attribution–Non Commercial–No Derivatives (or the CC BY – NC – ND 4.0 International) and in accordance with our TED Talks Usage Policy: https://www.ted.com/about/our-organization/our-policies-terms/ted-talks-usage-policy. For more information on using TED for commercial purposes (e.g. employee learning, in a film or online course), please submit a Media Request at https://media-requests.ted.com', 'https://yt3.ggpht.com/ytc/AOPolaTS7Iz8LJFYtCIX3_LB4XY3mAR214x3MjOD37bXkQ=s88-c-k-c0x00ffffff-no-rj'),
(2, 'UCWI-ohtRu8eEeDj93hmUsUQ', 'Coding with Lewis', 'My name is Lewis Menelaws. I have been professionally coding for 5 years and been hobbying for more than 8. I enjoy business and programming. My intentions with this channel are to share what I find interesting and inspire likeminded people while providing an entry-level insight on the technologies I use. Any business inquiries please direct to lewis@tmrrwinc.ca', 'https://yt3.ggpht.com/XCrBBAMNF2JLmu2UIMGxDV6nzclwfcnOvsHfkit2mG2rbD07QlR4XClZg5RP2zoaovP4mKfMZA=s88-c-k-c0x00ffffff-no-rj'),
(3, 'UCUOMtzQmEmhIAF8G_cha_Xw', 'Dorian Develops', 'idk wtf I\'m doing anymore...\n', 'https://yt3.ggpht.com/j_ZCn6PJZufZpCMRI9zRxWxnGkPY_PY5erbypulqeRPyPA2jZhGaTVVgyJH5NI2KPkKQRqeEneg=s88-c-k-c0x00ffffff-no-rj'),
(4, 'UCJ0-OtVpF0wOKEqT2Z1HEtA', 'ElectroBOOM', 'Want to subconsciously learn while being entertained? Then subscribe!!  \nMy twitter: https://twitter.com/ElectroBOOMGuy\nMy Instagram: https://www.instagram.com/mehdi_sadaghdar\nMy Facebook: http://www.facebook.com/ElectroBOOM\nMy videos are also available on Odysee in the link below, in case YouTube decides to remove them. Subscribe there too:\nhttps://odysee.com/$/invite/@ElectroBOOM:9\n\nIf you like my content and like to support your favorite creator, you can visit my page here: http://www.patreon.com/electroboom\nCheck my Merch and T-Shirts at: https://teespring.com/stores/electroboom\n\nAnd I have some articles in my website: http://electroboom.com\n\nSee my awesome and generous sponsors here: https://www.electroboom.com/?page_id=727 \n', 'https://yt3.ggpht.com/ytc/AOPolaRB8R7oQbHGTIGYF0zwHqjEoYWXd-xGC1_JEK7tOg=s88-c-k-c0x00ffffff-no-rj'),
(5, 'UCT9zcQNlyht7fRlcjmflRSA', 'ImagineDragons', 'Children of the Sky (a Starfield song) is out now: https://ImagineDragons.lnk.to/childrenofthesky\n', 'https://yt3.ggpht.com/aXBmHKABw-J-0ZMxj39wkXpLDEHViOdL5UD71cDG2s5vbeQBWk9mdX3rRxT5U6Wfkvm6o8Uu-dU=s88-c-k-c0x00ffffff-no-nd-rj'),
(12, 'UCwVQIkAtyZzQSA-OY1rsGig', 'Chill Music Lab', 'Choose the soundtrack for your most productive self\n\nMusic Lab was created to shed some light on how the music is made, educate and help people on how to navigate the intricacies of popular genres and how they can affect various activities. On this channel, we have a wide variety of playlists suited for all kinds of everyday tasks: work, studies, programming, sports and more. We want to popularize music that will have a beneficial effect on productivity.\n\nWe also collaborate with independent artists and labels within the USA and around the world. Many composers and producers are often unfairly overlooked and we strive to promote such artists by exposing their work to the widest possible audience.\n\nFor collaborations, business inquiries and licensing please contact us via the email below.\n\nDon\'t forget to check our website: https://musiclab.cloud\n', 'https://yt3.ggpht.com/9k0N3CXvGaQj44oSDb-r63amGX2w-orEyp409sTBp0tK4WEuZTJcdhO5XzmWaschG1aCcVjWnA=s88-c-k-c0x00ffffff-no-rj'),
(13, 'UCGbshtvS9t-8CW11W7TooQg', 'Muse Asia', 'Muse Communication is trusted by our clients and has been named as the agent of more than 30 well-known anime and manga copyright partners in the global anime market. The company has expanded its influence in the anime and manga community by expanding its presence in the media, becoming a strategic marketing partner for its clients, and creating licensing opportunities. We provide our clients with a wide range of professional services in licensing, distribution, development, sales, and promotion to meet all their needs and achieve benefits.\n\nWe provide clients with an all-rounded service to satisfy all your distribution needs.We work with over a hundred different entertainment platforms including internet services, TV stations, TV/OTT platforms across the whole of Asia.\n', 'https://yt3.ggpht.com/p2cg2LI1SBuY6c5dkXLhMVORpbMQ3AZGb-lmHqBaFM6qkceq2EdqDER9cRhw_KFGoBQRioia=s88-c-k-c0x00ffffff-no-rj'),
(15, 'UCE2606prvXQc_noEqKxVJXA', 'ABS-CBN News', 'The official YouTube channel of ABS-CBN News and Current Affairs. Updated daily with the latest breaking news!\n\nSubscribe to the ABS-CBN News channel! - http://bit.ly/TheABSCBNNews\n\nVisit our website at http://news.abs-cbn.com\nFacebook: https://www.facebook.com/abscbnNEWS\nTwitter: https://twitter.com/abscbnnews\nInstagram: https://www.instagram.com/abscbnnews', 'https://yt3.ggpht.com/ytc/AOPolaQpC-WkaA8TH6A3iU9K7ATMnHt2EcK_tmEVuek2=s88-c-k-c0x00ffffff-no-rj'),
(16, 'UCj6spMO3ybZPobE0T5perHA', 'CNN Philippines', 'CNN Philippines provides first-class news and information drawing on the strength and worldwide newsgathering power of CNN, and the local perspective and expertise of Nine Media Corporation. It offers Filipino viewers a global perspective on key issues and trending stories from around the world, together with in-depth local coverage.', 'https://yt3.ggpht.com/ytc/AOPolaQ1PTNQO_6RgwqpUf_DB0loymdabhzGTILjiaYs2Q=s88-c-k-c0x00ffffff-no-rj');
